import './addtodo.css';
const AddTodo = () => {
    return ( 
        <div className="AddTodo">
        <form>
              <div className="input-container">
                <div className="addtodo-top">
                      <div className={'money-bag'} style={
                        {background : 'linear-gradient(135deg, #BBB5E2 0%, #9C92DF 100%)'}
                      }>
                        <img src="icons/mb.png"  />
                      </div>
                     <input type="text" placeholder='Add Todo' input="addtitle"/>
                 </div>
                <textarea name="desc" id="AddDescription"></textarea>
                </div>
                <img src="icons/black-edit.png" className='edit-btn'></img>
              </form>
        </div>
     );
}
 
export default AddTodo;
